import axios from 'axios';

const API_BASE_URL = 'http://localhost:3000';

export function fetchGenres() {
  return axios.get(`${API_BASE_URL}/genres`)
    .then(response => response.data)
    .catch(error => {
      console.error('Failed to fetch genres:', error);
      throw error;
    });
}
